import React from 'react';
import '../styles.css';
import PageSetup from '../components/pageSetup';
import {useLocation} from 'react-router-dom';

const DataSheet = () => { 
    const {state} = useLocation();
    const { prodName, prodPrice, image, prodDescription } = state;

    return(<PageSetup generalTitle="Raide Energy" pageTitle="Detalles del producto">
        <div style={{textAlign: "left", paddingTop: "20px", paddingLeft: "50px", position: "relative",
                top: "35vh", fontSize: "20px",}}>
            {"Detalles"}{id}{color}
            <img src={image} style={{maxWidth:100, maxHeight:100}}/>
            {prodDescription}
        </div>
    </PageSetup>) 
}

export default DataSheet;
